import { Fragment } from "react";
import { useState } from "react";



import '../Estilos/Login.css';

export function CrearUsuarios() {

    const [data, setDate] = useState({
        user: "",
        pass: "",
        mail: "",
        name: "",
        rol: ""


    }
    )


    return (

        <Fragment>


            <div class="container-fluid col-6 col-md-6 pt-3 ps-4 bg-success bg-opacity-85 text-white" >

                <div id="divProductos"  >



                    <h3>Crear Productos</h3>

                    <Form.Group className="mb-3" controlId="formBasicProNombre">
                        <Form.Label>Nombre</Form.Label>
                        <Form.Control type="user"

                            onChange={(e) => {
                                setDate({ ...data, name: e.target.value })
                            }
                            } placeholder="Ingrese un Nombre al Producto " />

                    </Form.Group>


                    <Form.Group className="mb-3" controlId="formBasicProDescripcion">
                        <Form.Label>Nombre</Form.Label>
                        <Form.Control type="user"

                            onChange={(e) => {
                                setDate({ ...data, Descripcion: e.target.value })
                            }

                            } placeholder="Ingrese un Descripción " />

                    </Form.Group>





                    <Form.Group className="mb-3" controlId="formBasicProStock">
                        <Form.Label>Cantidad</Form.Label>
                        <Form.Control type="user"

                            onChange={(e) => {
                                setDate({ ...data, Stock: e.target.value })
                            }
                            } placeholder="Cantidad en stock " />

                    </Form.Group>




                    <Form.Group className="mb-3" controlId="formBasicProValorUni">
                        <Form.Label>Valor Unidad</Form.Label>
                        <Form.Control type="user"

                            onChange={(e) => {
                                setDate({ ...data, Valor: e.target.value })
                            }



                            } placeholder="Ingrese un Valor  " />

                    </Form.Group>





                    <div class="p-2">
                        <Button onClick={CrearUsuario} variant="primary" type="submit">
                            Crear Producto
                        </Button>
                    </div>



                </div>
            </div>

















            <center>
                <div id="divLogin">
                    <h3>Crear Usuarios</h3>
                    <label>Nombre
                        <input type="User" onChange={(e) => {
                            setDate({ ...data, name: e.target.value })
                        }
                        } ></input>
                    </label>
                    <br></br>
                    <br></br>
                    <label>Correo Electronico
                        <input type="User" onChange={(e) => {
                            setDate({ ...data, email: e.target.value })
                        }
                        } ></input>
                    </label>
                    <br></br>
                    <br></br>
                    <label>Rol
                        <input type="User" onChange={(e) => {
                            setDate({ ...data, rol: e.target.value })
                        }
                        } ></input>
                    </label>
                    <br></br>
                    <br></br>
                    <label>Usuario
                        <input type="User" onChange={(e) => {
                            setDate({ ...data, user: e.target.value })
                        }
                        } ></input>
                    </label>
                    <br></br>
                    <br></br>
                    <label>Contraseña
                        <input type="Pass" onChange={(e) => {
                            setDate({ ...data, pass: e.target.value })
                        }
                        }>
                        </input>
                    </label>
                    <br></br>
                    <br></br>
                    <button onClick={CrearUsuario} >Crear Usuario</button>

                </div>
            </center>
        </Fragment>


    );

    function CrearUsuario() {

    }
}
